import * as React from 'react';
import { DataGrid } from '@mui/x-data-grid';
import { textAlign } from '@mui/system';




export default function SearchResult(props) {
   //console.log(props);
  return (

    <div style={{ height: 250, width: 750 ,textAlign:'center' }}>
      {props.result.length? (<DataGrid
        columns={[{ field: 'id' }, { field: 'name' }]}
        rows={props.result.map(ele=>({ id: ele.id, name: ele['file-name']}))}
        getRowId={(row) => row.id}
      /> ):(<></>)}
    </div>
  );
}
